import React from 'react'
import { Link } from 'react-router-dom'

export default function Navbar() {

    return (
        <div>
            <Link to="profile">Profile</Link>
            <Link to="search">Search</Link>
            <Link to="/">Home</Link>
            <button>Logout</button>
        </div>
    )
}
